function ControlPanel({ sensors }) {
    console.log(sensors);

    return (  
        <div className="flex flex-row flex-wrap justify-center gap-10 border-solid border-[1px]">
            {
                sensors.map((face) => {
                    return <div key={face.face} className="flex flex-col items-center p-4 gap-y-4 border-solid border-[1px] w-[40vw]">
                        <div>{face.face}</div>
                        <div className="flex flex-row">
                            {
                                face.sensors.map(sensor => {
                                    return <div key={sensor.id} className="flex flex-col items-center justify-center w-[50px] aspect-square">{sensor.id}</div>
                                })
                            }
                        </div>
                    </div>
                })
            }
        </div>
    );
}

export default ControlPanel;
